window.bookSummaryJSON = "<p>The epic third story in the #1 New York Times bestselling Court of Thorns and Roses series by Sarah J. Maas.<br> <br> Feyre has returned to the Spring Court, determined to gather information on Tamlin's actions and learn what she can about the invading king threatening to bring her land to its knees. But to do so she must play a deadly game of deceit. One slip could bring doom not only for Feyre, but for everything-and everyone-she holds dear.<br> <br> As war bears down upon them all, Feyre endeavors to take her place amongst the High Fae of the land, balancing her struggle to master her powers-both magical and political-and her love for her court and family. Amidst these struggles, Feyre and Rhysand must decide whom to trust amongst the cunning and lethal High Lords, and hunt for allies in unexpected places.<br> <br> In this thrilling third audiobook in the #1 New York Times bestselling series from Sarah J. Maas, the fate of Feyre's world is at stake as armies grapple for power over the one thing that could destroy it.<br> <br> Performed by Melody Muze, Anthony Palmini, Amanda Forstrom, Natalie Van Sistine, Jon Vertullo, Nora Achrati, Karenna Foley, Shawn K. Jain, Ryan Haugen, Alejandro Ruiz, Rayner Gabriel, Mike Carnes, Danny Gavigan, Chris Stinson, Gabriel Michael, Megan Dominy, Terence Aselford, Jenna Sharpe, Ryan Carlo Dalusung, KenYatta Rogers, Colleen Delany, Alex Hill-Knight, Holly Adams, Andrew Mimms, Alysia Beltran, Rob McFadyen, Tia Shearer, Nhea Durousseau, Matthew Bassett, Christopher Graybill, Michael John Casey, Henry W. Kramer, and Marni Penning.</p>"; 
